import React from 'react'

//----------------------------------------
export default function TimeCard(props) {
    const {timeEntry: {startTime, endTime, timeEntry}} = props;

    return (
        <div className='timecard'>
            <div className='time-stamp'>
                <TimeStamp start={startTime} end={endTime} />
            </div>
            <div className='time-entry'>
                <GetHours timeEntry={timeEntry} />
            </div>
        </div>
    )
}

//--- Helper Functions for TimeCard ---
const TimeStamp = (props) => {
    const {start, end} = props;

    const startHours = start.getUTCHours()
    const startMinutes = start.getUTCMinutes()
    const endHours = end.getUTCHours()
    const endMinutes = end.getUTCMinutes()

    return (
        <span>{startHours}:{startMinutes} - {endHours}:{endMinutes}</span>
    )
}

const GetHours = props => {
    const {timeEntry} = props;
    const hours = (timeEntry / 3600000).toFixed(2)

    return (
        <span>{hours} hrs</span>
    )
}
